import React from 'react';
import { Link } from 'react-router-dom'


const Villagers = ({match, villagers}) => {
  const list = villagers && props.villagers.map(villager =>
    <li key={villager.id}> <Link to={`${match.url}/${villager.id}`}> {villager.name} </Link> </li>)
  return (
    <ul>
      {list}
    </ul>
  )
}

export default Villagers;
